-- Função para definir transparência, ignorando partes do personagem do jogador
local function setTransparency(object)
    if not object:IsDescendantOf(playerCharacter) then
        pcall(function()
            object.Transparency = 1
        end)
    end
end

-- Aplicar transparência a todos os descendentes do workspace
for _, v in pairs(workspace:GetDescendants()) do
    setTransparency(v)
end

-- Monitorar novos descendentes no workspace
workspace.DescendantAdded:Connect(function(v)
    setTransparency(v)
end)
